function goBack() {
    window.history.back()
}
var menuTrigger = document.getElementById("js-menu-button");
menuTrigger.addEventListener("click", function () {
    let t = "true" === this.getAttribute("aria-expanded") || !1;
    this.setAttribute("aria-expanded", !t);
    let e = document.getElementById("js-menu"),
        i = "true" === e.getAttribute("data-visible") || !1;
    e.setAttribute("data-visible", !i)
});
